import React, { Component } from "react";
import Button from "@material-ui/core/Button";

class Welcome extends Component {
  render() {
    return (
      <div className="Welcome">
        <Button> This is the Welcome Page</Button>
      </div>
    );
  }
}

export default Welcome;
